// Apply chart themes
am4core.useTheme(am4themes_animated);

var chart = am4core.create("chartdiv", am4charts.XYChart);
chart.maskBullets = false;

var xAxis = chart.xAxes.push(new am4charts.CategoryAxis());
var yAxis = chart.yAxes.push(new am4charts.CategoryAxis());

xAxis.dataFields.category = "from";
yAxis.dataFields.category = "to";

xAxis.renderer.grid.template.disabled = true;
xAxis.renderer.minGridDistance = 40;

yAxis.renderer.grid.template.disabled = true;
yAxis.renderer.inversed = true;
yAxis.renderer.minGridDistance = 30;

var series = chart.series.push(new am4charts.ColumnSeries());
series.dataFields.categoryX = "from";
series.dataFields.categoryY = "to";
series.dataFields.value = "value";
series.sequencedInterpolation = true;
series.defaultState.transitionDuration = 3000;
series.columns.template.width = am4core.percent(100);
series.columns.template.height = am4core.percent(100);


var columnTemplate = series.columns.template;
columnTemplate.strokeWidth = 1;
columnTemplate.strokeOpacity = 1;
columnTemplate.stroke = am4core.color("#000");
columnTemplate.tooltipText = "{from}, {to}: {value.workingValue.formatNumber('#.')}";

columnTemplate.column.adapter.add("fill", function(fill, target) {
  if (target.dataItem) {
    if (target.dataItem.value > 0 && target.dataItem.value <= 2000) {
      return am4core.color("#0F4B87")
    }
    else if (target.dataItem.value > 2000 && target.dataItem.value <=4000) {
      return am4core.color("#FFC300")
    }
     else if (target.dataItem.value > 4000 && target.dataItem.value <=6000) {
      return am4core.color("#0FF24D")
    }
     else if (target.dataItem.value > 6000 && target.dataItem.value <=8000) {
      return am4core.color("#FF5733")
    }
     else if (target.dataItem.value > 8000 && target.dataItem.value <=10000) {
      return am4core.color("#FF2EF9")
    }
     else if (target.dataItem.value > 10000) {
      return am4core.color("#2CF7EB")
    }
    else {
      return am4core.color("#f00");
    }
  }
  return fill;
});
 
